    width:"441px",
    height:"55px",
    marginTop:"163px",
    backgroundColor:"rgba(241, 34, 34, 0.08)",
    boxShadow:"2px 2px 29px black inset"
  }

const Displayresult=()=>{
  if(flag==-1){
return(
        <>
    <div style={boundaryObj}>
    <span>{}</span>
    </div>
        </>
        
) 
  }
  else{
    return(
      <>
  <div style={boundaryObj}>
  <span>{flag}</span>
  </div>
      </>
    )
  }
